import { Board } from "./board";
import { Card } from "./card";
import { Context } from "./context";
import { Deck } from "./deck";
import { Dnd } from "./dnd";
import { generateId } from "./utils";

export class VttApp {
  ctx: Context;
  dnd: Dnd;
  el: HTMLElement;

  constructor(el: Element, private fileData: string) {
    this.dnd = new Dnd();
    this.ctx = new Context();
    this.el = el as HTMLElement;

    this.el.style.backgroundImage =
      "url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAACgAAAAoCAYAAACM/rhtAAAAAXNSR0IArs4c6QAAAHFJREFUWIXt0bEJxDAUBNG1OBC/GPXf2KJEwTlyZnAwgRTsq2BgrjHGv6pkW7Z1mlZVkqTe++aUd8221lqac+5uefU7de2j7Q74kkAqgVQCqQRSCaQSSCWQSiCVQCqBVAKpBFIJpBJIJZBKIJVA6vjAG8fRFkLBinVjAAAAAElFTkSuQmCC)";
  }

  update(fileData: string) {
    this.fileData = fileData;
  }

  render() {
    const board = new Board(this);
    const deck = new Deck(board, {
      id: generateId("d"),
      position: {
        x: 300,
        y: 100,
      },
      image:
        "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAQAAAC1HAwCAAAAC0lEQVR42mNkYAAAAAYAAjCB0C8AAAAASUVORK5CYII=",
    });
    deck.cards.push(
      new Card(board, {
        id: generateId("c"),
        position: {
          x: 20,
          y: 20,
        },
        image:
          "data:image/png;base64,\n",
      })
    );
    deck.cards.push(
      new Card(board, {
        id: generateId("c"),
        position: {
          x: 80,
          y: 80,
        },
        image:
          "data:image/png;base64,\n",
      })
    );
  }

  unrender() {
    this.dnd.cleanup();
  }
}
